import React from "react";
import style from "../header/style.module.css";
import AnimatedBg from "react-animated-bg";

const Header = () => {
  return (
    <div>
      <AnimatedBg colors={["red", "#ef4f03", "rgb(47, 53, 255)"]}>
        My element with animated BG
      </AnimatedBg>
    </div>
  );
};

export default Header;
